import React from 'react';
import { Router, Route } from 'react-router-dom';
import { createBrowserHistory } from 'history';



import Landing from '../screens/Landing';
import Login from '../screens/Login'; // Keep
import Home from '../screens/Home'; // Convert into home page -- daily survey / contact list + add contacts / Suggested course of action

import RegisterRestaurant from '../screens/RegisterRestaurant'; // Save for later maybe use for referalls within home page
import AddMenuItems from '../screens/AddMenuItems'; // Save for later or copy elements into survey in home page


import Restaurants from '../screens/Restaurants'; // Yeet
import RestaurantDetails from '../screens/RestaurantDetails'; 
import MyOrders from '../screens/MyOrders'; // yeet
import MyFoods from '../screens/MyFoods'; // yeet  */



const customHistory = createBrowserHistory();

// Routes For Navigation
const MyRoutes = () => (
    <Router history={customHistory}>
        <div>
            <Route exact path='/' component={Landing}></Route>
            <Route path='/login' component={Login}></Route>
            <Route path='/home' component={Home}></Route>


            <Route path='/register-restaurant' component={RegisterRestaurant}></Route>
            <Route path='/add-menu-items' component={AddMenuItems}></Route>




            <Route path='/restaurants' component={Restaurants}></Route>
             <Route path='/restaurant-details' component={RestaurantDetails}></Route>
            <Route path='/my-orders' component={MyOrders}></Route>
            <Route path='/my-foods' component={MyFoods}></Route>
        </div>
    </Router>
)

export default MyRoutes
